import React, { useState,useEffect } from 'react'
import { Form } from 'semantic-ui-react'

function SignUpFormCompany(){
    const [company_name, setCompanyName] = useState("");
    const [email,setEmail] = useState("");
    const [pass,setPass] = useState("");
    const [confirm_pass,setConfirmPass] = useState("");

    return (
        <Form>
          <Form.Input fluid id="company_name" label='Company Name' placeholder='Name' value={company_name} onChange={e => setCompanyName(e.target.value)}/>
          <Form.Input fluid id="email" label='Company Email' placeholder='Email' value={email} onChange={e => setEmail(e.target.value)}/>
          <Form.Input fluid id="pass" label='Enter Password' type='password' value={pass} onChange={e => setPass(e.target.value)}/>
          <Form.Input fluid id="confirm_pass" label='Confirm Password' type='password' value={confirm_pass} onChange={e => setConfirmPass(e.target.value)}/>
          <Form.Button>Submit</Form.Button>
        </Form>
    );
}

export default SignUpFormCompany;
